(97, 'about_us', '<h1>ABOUT US</h1>\r\n\r\n<p>madeByMaa is presenting the new way of food delivery app with tech innovation &amp; business intelligence intending to make every mom/woman a micro-entrepreneur.</p>\r\n\r\n<h3><small>CUSTOMER</small></h3>\r\n\r\n<h5><big>Enjoy delivery from your long-time favorites or discover your new go-to. Craving Chinese, South Indian, North Indian, Bengali, Gujarati, or More. From Healthy to Hearty, Pizza to Salad, Sweet to Samosa, Cake to Cookies, Burgers to Biryani, Meal to Malaai Chap &ndash; Order food for every mood, occasion, and taste.</big><br />\r\n&nbsp;</h5>\r\n\r\n<ul>\r\n	<li>\r\n	<h5><big>Nearby best MoM chefs are available.</big></h5>\r\n	</li>\r\n	<li>\r\n	<h5><big>On-demand delivery.</big></h5>\r\n	</li>\r\n	<li>\r\n	<h5><big>Avail food offers and discounts.</big></h5>\r\n	</li>\r\n	<li>\r\n	<h5><big>Choose from a varied range of food items.</big></h5>\r\n	</li>\r\n	<li>\r\n	<h5><big>Design is clearer, cleaner, and cooler than ever.</big></h5>\r\n	</li>\r\n	<li>\r\n	<h5><big>Better overview of opening times.</big></h5>\r\n	</li>\r\n	<li>\r\n	<h5><big>Delivery cost is minimal and displayed.</big></h5>\r\n	</li>\r\n</ul>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<h3><small>MISSION</small></h3>\r\n\r\n<h5><big><kbd><small>&quot;Every mother will be an entrepreneur&quot;<br />\r\nMadeByMaa is on a mission to create the largest self-employment opportunity for mothers or women.</small></kbd></big></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><small>VISSION</small></h3>\r\n\r\n<h4><small><big><samp><kbd><tt>We envision a community where everyone can access good quality, nutritious, homemade food.</tt></kbd></samp></big></small></h4>\r\n\r\n<h3><small>WORK LIKE THIS</small></h3>\r\n\r\n<h5><small>It&rsquo;s super easy to use MadeByMaa - here&rsquo;s how it works: Download the app&gt;Open&gt;sign-up&gt;Enter your location or simply let the app find your location automatically&gt;select your dish. You can easily pay with a Debit card, Credit Card, UPI, Internet Banking, and payment gateway.</small><br />\r\n&nbsp;</h5>\r\n\r\n<h3><small>MOM CHEF</small></h3>\r\n\r\n<h5><small>With a mission &ldquo;Every Mother Will Be An Entrepreneur&rdquo; MadeByMaa aims to provide the largest self-employment opportunity to mothers/women.<br />\r\n<br />\r\nMadeByMaa has been very selective and responsible in selecting Master Mom Chef. As a practice, the MadeByMaa team visits the aspiring Home chef to check for Food Tasting, Food quality, hygiene, and cleanliness of their kitchen and Packaging standards. All Sellers are 100% FSSAI Certified.</small><br />\r\n&nbsp;</h5>\r\n\r\n<h5><small>DELIVERY</small></h5>\r\n\r\n<h5><small>Delivering with madeByMaa, you get flexibility and financial stability. All on your schedule and your terms.</small></h5>\r\n\r\n<h5><small>â</small></h5>\r\n\r\n<h5><small>â</small></h5>\r\n\r\n<h5><small>â</small></h5>\r\n\r\n<h5><small>â</small></h5>\r\n\r\n<h5><small>â</small></h5>\r\n\r\n<h5><small>â</small></h5>', 'admin_landing_page', '2024-05-11 17:53:10', '2024-05-14 17:19:25'),
(98, 'cancellation_policy', '<h1>CANCELLATION AND REFUND POLICY</h1>\r\n\r\n<p><br />\r\nAny capitalized terms used but not defined herein shall have the meaning assigned to them under the Terms of use which govern your use of our website www.madebymaa.in (the &ldquo;website&rdquo;) and our madeByMaa application for mobile and handheld devices(the &ldquo;App&rdquo;). The website and the app are jointly referred to as the platform.<br />\r\n&nbsp;</p>\r\n\r\n<h6>Customer Cancellation &amp; Refund</h6>\r\n\r\n<p>As a general rule Buyer shall not be entitled to cancel the Order once placed. madeByMaa shall have a right to collect a penalty of 100% of the Order amount for breach of contract terms as to compensation for the damages suffered to MadeByMaa, with a right to either not to refund the order value.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>If the address provided by the customer is either wrong or falls outside the delivery zone</p>\r\n	</li>\r\n	<li>\r\n	<p>Failure to contact the customer by phone or email at the time of delivering the Order booking</p>\r\n	</li>\r\n	<li>\r\n	<p>Failure to deliver customer Orders due to lack of information, direction, or authorization from the Customer at the time of delivery.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>This policy helps us avoid food wastage and compensate seller/home chef/delivery partners for their efforts.<br />\r\nIf you find the food unsatisfactory, we are happy to take your feedback and resolve the problem in our future orders.<br />\r\n&nbsp;</p>\r\n\r\n<h6>Seller Cancellation &amp; Refund</h6>\r\n\r\n<p>Unavailability of all the items ordered by Customer at the time of booking the Order. Unavailability of the quantity of all the items ordered by the customer at the time of booking of the order.<br />\r\n<br />\r\nMadeByMaa will contact the Customer on the phone number provided to us at the time of placing the Order and inform the customer of such unavailability and return any payment that you have made. Refunds will take 5-7 working days, depending upon the mode of payment collection.</p>\r\n\r\n<p>â</p>\r\n\r\n<p>â</p>\r\n\r\n<p>â</p>\r\n\r\n<p>â</p>\r\n\r\n<p>â</p>\r\n\r\n<p>â</p>', 'admin_landing_page', '2024-05-11 17:54:40', '2024-05-14 17:23:21'),
(99, 'refund_policy', '<h1>CANCELLATION AND REFUND POLICY</h1>\r\n\r\n<p><br />\r\nAny capitalized terms used but not defined herein shall have the meaning assigned to them under the Terms of use which govern your use of our website www.madebymaa.in (the &ldquo;website&rdquo;) and our MadeByMaa application for mobile and handheld devices(the &ldquo;App&rdquo;). The website and the app are jointly referred to as the platform.<br />\r\n&nbsp;</p>\r\n\r\n<h6>Customer Cancellation &amp; Refund</h6>\r\n\r\n<p>As a general rule Buyer shall not be entitled to cancel the Order once placed. MadeByMaa shall have a right to collect a penalty of 100% of the Order amount for breach of contract terms as to compensation for the damages suffered to MadeByMaa, with a right to either not to refund the order value.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>If the address provided by the customer is either wrong or falls outside the delivery zone</p>\r\n	</li>\r\n	<li>\r\n	<p>Failure to contact the customer by phone or email at the time of delivering the Order booking</p>\r\n	</li>\r\n	<li>\r\n	<p>Failure to deliver customer Orders due to lack of information, direction, or authorization from the Customer at the time of delivery.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>This policy helps us avoid food wastage and compensate seller/home chef/delivery partners for their efforts.<br />\r\nIf you find the food unsatisfactory, we are happy to take your feedback and resolve the problem in our future orders.<br />\r\n&nbsp;</p>\r\n\r\n<h6>Seller Cancellation &amp; Refund</h6>\r\n\r\n<p>Unavailability of all the items ordered by Customer at the time of booking the Order. Unavailability of the quantity of all the items ordered by the customer at the time of booking of the order.<br />\r\n<br />\r\nMadeByMaa will contact the Customer on the phone number provided to us at the time of placing the Order and inform the customer of such unavailability and return any payment that you have made. Refunds will take 5-7 working days, depending upon the mode of payment collection.</p>\r\n\r\n<p>â</p>\r\n\r\n<p>â</p>\r\n\r\n<p>â</p>\r\n\r\n<p>â</p>\r\n\r\n<p>â</p>\r\n\r\n<p>â</p>', 'admin_landing_page', '2024-05-11 17:54:55', '2024-05-14 17:20:29'),
(100, 'privacy_policy', '<h1>Privacy Policy</h1>\r\n\r\n<p>â</p>\r\n\r\n<p>By visiting and/or accessing our website https://www.madebymaa.in, and/or by downloading/using our services through our mobile application,(collectively Platform&rdquo;), you agree to be bound by the terms of this Privacy Policy. For this Privacy Policy, the term &quot;Us&quot;, &quot;We&rdquo;, or &ldquo;our-refers to MadeByMaa Food Network Private Limited. The term &quot;You&quot;, &quot;Your&quot; or &quot;user&quot; refers to the end-user and the user selling edibles on the Platform. This Privacy Policy is a part of the Terms of Use available at https://www.madebymaa.in/ and all terms defined in the Terms of Use have the same meaning used here in this Privacy Policy.</p>\r\n\r\n<p>By visiting Our Platform and or by providing Your information and/or by availing Our services, you consent to the collection, storage, and use of the information You disclose on Our Platform following this Privacy Policy, including but not limited to, Your consent for sharing Your information as per this Privacy Policy. You acknowledge and agree that even if you are not a registered user with us. We may collect information about You. If a registered user has provided us with your information to facilitate services.</p>\r\n\r\n<p>If we decide to change Our Privacy Policy, We will post those changes on this page so that you are always aware of what information We collect, how We use it, and under what circumstances We disclose it. We request you to peruse this Privacy Policy from time to time. If you do not agree to the foregoing, please do not continue to use or access Our Platform</p>\r\n\r\n<p>1. Collection of Identifiable Information</p>\r\n\r\n<p>&nbsp; &nbsp; 1.1 We collect information that can identify You personally or information that can identify Your business.</p>\r\n\r\n<p>&nbsp; &nbsp; 1.2 When you visit/use Our Platform, Our server will collect the following information such as:</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1.2.1 Your IP address:</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1.2.2 The website from which you were referred to our website (e.g, if you followed a link):</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1.2.3 The web pages you are visiting on our website;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1.2:4 The browser you are using and its display settings</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1.2.5 Your operating system:</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1.2.6 The date and duration of your visit.</p>\r\n\r\n<p>&nbsp; &nbsp; 1.3 If you are desirous of registering with us. You will be required to provide certain other information about You to help us serve you better. The information collected by Us includes the information provided by You,&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;like:</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.3.1 Name, e-mail address, mobile number, address, city, bank account details, and other data that you may have chosen to provide on the Platform for registration.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.3.2 Any other information, may be required by us, for providing our services to You.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;1.4 You acknowledge that we collect end-user information either from Our registered users or from third parties, to enable such end-users to avail themselves of the payment services through Our Platform. Any such end-user information or transaction information will include, without limitation, the transactional information and details as may be necessary to provide our services to You.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;1.5 We may use this information to do internal research on Our Users&#39; demographics, interests, and behavior to better understand, protect and serve Our Users. This information is compiled and analyzed on an aggregated basis.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;1.6 You acknowledge and agree that the information mentioned hereinabove may be collected by us in an encrypted format or an unencrypted format.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;1.7 You acknowledge and agree that any data or information collected by us is data and information that has been voluntarily provided by You. We will not be responsible for the accuracy or correctness of any such information. You undertake to indemnify us for any losses that we may suffer due to any claim raised against us concerning any data and/or information that is provided by You to us.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 1.8 You may be required to upload/share certain documents for registration and KYC purposes (including, without limitation registrations if any. identity proof residential proof, business proof, a canceled cheque, and photographs of the business establishment that are required by Us to render Our services to you. If you choose to decline to share such documents with us, we may not be able to provide our services to you and we shall not be liable and or responsible for the non-provision of our services to you. Any document provided by You will not be considered sensitive and confidential if it is freely available and /or accessible in the public domain.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 1.9 During the registration, We indicate fields that are mandatorily required to be filled and fields that are optional. The Users may decide whether or not to provide such information to us. In case you choose to decline to submit information on the platform. We may not be able to provide certain services to you and we shall not be liable and responsible for the non-provision of services to you. Any information provided by You will not be considered as sensitive and confidential if it is freely available and/or accessible in the public domain</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 1.10 We may automatically track certain information about You Based on your behavior on Our Platform. This information may include the URL that you just came from (whether this URL is on Our Platform or not), which URL You next go to (whether the URL is on Our Platform or not. Your browser information, and your IP address</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;1.11 On Our Platform. We use data collection devices such as cookies on certain pages to help analyze our web page flow, measure promotional effectiveness, and promote trust and safety. &quot;Cookies&quot; are small files placed on your hard drive that assist us in providing Our services. We offer certain features that are only available through the use of a &quot;cookie&quot;. You are always free to decline Our cookies if Your browser permits, although in that case, You may not be able to use certain features on the platform. Additionally, you may encounter &quot;cookies&quot; or other similar devices on certain pages of the Platform that are placed by third parties. We do not control the use of cookies by third parties.</p>\r\n\r\n<p>2. Additional Information</p>\r\n\r\n<p>When You use Our services, We may collect information about You, with your permission, in the following general categories:</p>\r\n\r\n<p>&nbsp; &nbsp; 2.1 Location Information: When You use the Platform through the telecommunication device. We collect your location data. If You permit the Platform to access your location through the permission system used by your mobile operating system, we may also collect the precise location of your device when the Platform is running in the foreground or background. We may also derive Your approximate location from</p>\r\n\r\n<p>Your IP address.</p>\r\n\r\n<p>&nbsp; &nbsp;2.2 Device Information we may collect information about your mobile device, including, for example, the hardware model, operating system and version, software and file names, preferred language, unique device identifier, advertising identifiers, serial number, device motion information, and mobile network Information</p>\r\n\r\n<p>3. Use the information</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 3.1 The information collected by us through our Platform may be used inter alia for the following purposes:</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 3.1.1 To provide our services to you:</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 3.1.2 Internal record keeping</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 3.1.3 To improve our products and services or provide new products and services</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 3.1.4 For sales and marketing purposes with your prior permission</p>\r\n\r\n<p>&nbsp; &nbsp;3.2 We may periodically send promotional e-mails or messages on the platform about special offers or other information that we think you may find interest</p>\r\n\r\n<p>&nbsp; 3.3 From time to time, We may use the information to customize the Platform according to your interests</p>\r\n\r\n<p>&nbsp; 3.4 We may use the information provided by you to resolve disputes that may arise with the use of services, help promote the same service to all the Users of the platform measure consumer interest in our services, customize your experience detect and protect us against error. Fraud and other criminal activity, enforce Our terms and conditions.</p>\r\n\r\n<p>&nbsp; &nbsp;3.5 We identify and use your IP address to help diagnose problems with our server and to administer Our Platform. Your IP address is also used to help identify you and to gather broad demographic information</p>\r\n\r\n<p>4. Sharing of Information</p>\r\n\r\n<p>&nbsp; &nbsp; 4.1 We share Your Information with payment service providers and regulatory authorities in the event of any request from such authorities.</p>\r\n\r\n<p>&nbsp; &nbsp;4.2 We may also share your information with third parties/Users/sellers to manage, improve and expedite the provision of services provided to you under strict obligations of confidentiality. Without limiting the generality herein, the sellers may receive your information such as name, address, and phone number to facilitate the completion of your orders</p>\r\n\r\n<p>&nbsp; &nbsp;4.3 We may disclose the information provided by you, if required to do so by law or in the good faith belief that such disclosure is reasonably necessary to respond to subpoenas, court orders, or other legal processes. We may disclose this information to law enforcement offices, third party rights owners, or others in the good faith belief that such disclosure is reasonably necessary to enforce Our Terms or Privacy Policy, respond to claims that an advertisement posting or other content violates the rights of a third party, or protect the rights, property or personal safety of our users of the general public</p>\r\n\r\n<p>5. Updating Information</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;We shall make&nbsp;</p>\r\n\r\n<p>good faith efforts to provide you access to your information, upon request from you, and shall further ensure that any information found to be inaccurate or deficient shall be corrected, subject to any requirement for such information to be retained by law or for legitimate business purposes. We shall ask you to identify yourself and the information requested to be accessed, corrected, or removed before processing such requests. We may decline to process requests that are unreasonable or extremely impractical, require disproportionate technical effort. jeopardize the privacy of others. Even after you delete your information, residual copies may remain in our backup systems</p>\r\n\r\n<p>6.Information Safety</p>\r\n\r\n<p>&nbsp; &nbsp; 6.1 All information is saved and stored on servers, which are secured with passwords and pins to ensure no unauthorized person has access to it.</p>\r\n\r\n<p>Once your Information in our possession we adhere to strict security guidelines, protecting it against unauthorized access</p>\r\n\r\n<p>7. Choice/Opt-Out</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;7.1 We provide all users with the opportunity to opt-out of receiving non-essential (promotional marketing-related communications from Us on behalf of our partners, and from us in general, after providing us with information. If you want to remove your contact information from a list, please contact help@madebymaa.in.</p>\r\n\r\n<p>&nbsp; &nbsp; 7.2 If you choose to unsubscribe from the platform or delete any or all of our information. You may send an email to help@madebymaa.in.</p>\r\n\r\n<p>Please note, We may still retain some information and record of transactions as required by law. contact or policy applicable to us.</p>\r\n\r\n<p>8.Grievance Redressal</p>\r\n\r\n<p>In case of any grievance arising from the use of the Platform. Please write to help@madebymaa.in</p>', 'admin_landing_page', '2024-05-11 17:55:33', '2024-05-11 18:04:42');
