(266, 'Masala paddu', 'Masala Paddu, also known as Appe, is a South Indian breakfast dish made with a fermented rice and lentil batter, traditionally cooked in a special pan. It is a fluffy, slightly crispy roundel or dumpling, often served with coconut chutney or sambar. The batter is made by soaking and grinding rice and lentils, mixing with salt, and allowing it to ferment for a few hours or overnight. Masala Paddu, also known as Appe or Paniyaram, is a South Indian breakfast dish made with a fermented rice and lentil batter, traditionally cooked in a special pan. It is a fluffy, slightly crispy roundel or dumpling, often served with coconut chutney or sambar.', 'Rice,lentils,', '2025-12-05-6932af0438491.png', 47, '[{\"id\":\"47\",\"position\":1}]', '[4,5,9,10]', NULL, '[]', '[]', '[]', 140.00, 0.00, 'percent', 0.00, 'percent', NULL, NULL, '{\"monday\":{\"breakfast\":{\"available\":true,\"main_category_id\":4},\"lunch\":{\"available\":true,\"main_category_id\":5},\"evening\":{\"available\":true,\"main_category_id\":9},\"dinner\":{\"available\":true,\"main_category_id\":10}},\"tuesday\":{\"breakfast\":{\"available\":true,\"main_category_id\":4},\"lunch\":{\"available\":true,\"main_category_id\":5},\"evening\":{\"available\":true,\"main_category_id\":9},\"dinner\":{\"available\":true,\"main_category_id\":10}},\"wednesday\":{\"breakfast\":{\"available\":true,\"main_category_id\":4},\"lunch\":{\"available\":true,\"main_category_id\":5},\"evening\":{\"available\":true,\"main_category_id\":9},\"dinner\":{\"available\":true,\"main_category_id\":10}},\"thursday\":{\"breakfast\":{\"available\":true,\"main_category_id\":4},\"lunch\":{\"available\":true,\"main_category_id\":5},\"evening\":{\"available\":true,\"main_category_id\":9},\"dinner\":{\"available\":true,\"main_category_id\":10}},\"friday\":{\"breakfast\":{\"available\":true,\"main_category_id\":4},\"lunch\":{\"available\":true,\"main_category_id\":5},\"evening\":{\"available\":true,\"main_category_id\":9},\"dinner\