(90, 'App\\Models\\DataSetting', 101, 'en', 'terms_and_conditions', '<h1>USER TERM &amp; CONDITIONS</h1>\r\n\r\n<p>This document is an electronic record in terms of the Information Technology Act, 2000 and rules made there about electronic records. This document is published by the provisions of Rule 3 (1) of the Information Technology (Intermediaries guidelines) Rules, 2011 that require publishing the rules and regulations, privacy policy, and Terms of Use for access or usage of [website address] website and MadeByMaa application for mobile and handheld devices. The Website and the Application for handheld devices are jointly referred to as the &ldquo;Platform&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>DEFINITIONS :</p>\r\n\r\n<p>User: &quot;User&quot; or &quot;You&quot; or &quot;Your&quot; refers to you, as a user of the Services. A user is someone who accesses or uses the Services to host, publish, transact, share, display, or upload information or views or pictures and includes other persons jointly participating in using the Services, including, without limitation, a user having access to &ldquo;Home Chef business page&#39; to manage claimed Home Chef listings or otherwise.</p>\r\n\r\n<p>Content: &quot;Content&quot; will include (but is not limited to) reviews, images, photos, audio, video, location data, nearby places, and all other forms of information or data.</p>\r\n\r\n<p>&quot;Your Content&quot; or &quot;User Content&quot; means content that you upload, share, or transmit to, through or in connection with the Services, such as likes, ratings, reviews, images, photos, messages, profile information, and any other materials that you publicly display or displayed in your account profile.</p>\r\n\r\n<p>&quot;Third Party Content&quot; means content that comes from parties other than MadeByMaa or its users and is available on the Services.</p>\r\n\r\n<p>&quot;MadeByMaa Content&quot; means content that &ldquo;MadeByMaa&rdquo; creates and makes available in connection with the Services including, but not limited to, graphics, design, compilation, computer code, products, software, visual interfaces, interactive features, aggregate ratings, reports, and other usage-related data in connection with activities associated with your account and all other elements and components of the Services excluding Your Content and Third Party Content.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>TERMS:</p>\r\n\r\n<p>MadeByMaa (MadeByMaa Food Network Private Limited )(hereinafter referred to as &quot;MadeByMaa &quot;, &quot;we&quot;, &quot;us&quot;, or &quot;our&quot;) provides an online marketplace that connects Home-chefs who want to provide Food Services to users looking for home-cooked meals (collectively, the &quot;Services&quot;). By using the Application and the Services, you agree to comply with and be legally bound by the terms and conditions of these Terms of Service (&quot;Terms&quot;), whether or not you become a registered user of the Services. These Terms govern your access to and use of the Application, Services, and all content, and your participation in referral and other promotion programs undertaken by us from time to time (&quot;Referral Programs&quot;), and these terms of use constitute a binding legal agreement between you and MadeByMaa. Please read carefully these Terms and our Privacy Policy, which may be found here, and which is incorporated by reference into these Terms.</p>\r\n\r\n<p>If you do not agree to these Terms, you have no right to obtain information from and/or otherwise use the Application or Services.</p>\r\n\r\n<p>These Terms of Service (the &quot;Terms&quot;) are intended to make you aware of your legal rights and responsibilities concerning your access to and use of the website at [web address] (the &quot;Site&quot;) and any related mobile or software applications including but not limited to delivery of information via the website whether existing now or in the future that links to the Terms (collectively, the &quot;Services&quot;). These Terms are effective for all existing and future users, including but without limited to users having access to their restaurant business page&#39; to manage their claimed business listings.</p>\r\n\r\n<p>Please read these Terms of Use carefully before you use the services. If you do not agree to these Terms of Use, you may not use the services on the Platform, and we request you to uninstall the App. By installing, downloading, or even merely using the Platform, you shall be contracting with MadeByMaa and signify your acceptance to the Terms of Use and other policies (including but not limited to the Cancellation &amp; Refund Policy, Privacy Policy, and Take Down Policy) as posted on the Platform from time to time, which takes effect on the date on which you download, install or use the Services, and create a legally binding arrangement to abide by the same. You may not use the Services if you do not accept the Terms or are unable to be bound by the Terms. Your use of the Platform is at your own risk, including the risk of data theft, virus attack, or that you might be exposed to content that is objectionable, or otherwise inappropriate.</p>\r\n\r\n<p>The Content on these Services is for informational purposes only. MadeByMaa disclaims any liability for any information that may have become outdated since the last time the particular piece of information was updated. MadeByMaa reserves the right to make changes and corrections to any part of the Content on these Services at any time without prior notice. MadeByMaa does not guarantee the quality of the Goods, the prices listed in menus, or the availability of all menu items at any of the listings of Home Chefs.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ELIGIBILITY TO USE THE SERVICES:</p>\r\n\r\n<p>You hereby represent and warrant that you are at least eighteen (18) years of age or above and are fully able and competent to understand and agree to the terms, conditions, obligations, affirmations, representations, and warranties outlined in these Terms. You further declare that you comply with all laws and regulations in the locality/state/country in which you live when you access and use the Services. You agree to use the Services only in compliance with these Terms and applicable law, and in a manner that does not violate our legal rights or those of any third party(ies).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>CHANGES TO THE TERMS:</p>\r\n\r\n<p>We may vary amend change or update these Terms, from time to time entirely at its discretion. Your use of Platform after any such amendment or change in the Terms shall be deemed as your express acceptance to such amended/changed terms and you also agree to be bound by such changed/amended Terms. You shall be responsible for checking these Terms from time to time and ensuring continued compliance with these Terms. These Terms of Use are subject to modifications at any time. We reserve the right to modify or change these Terms of Use and other MadeByMaa policies at any time by posting changes on the Platform, and you shall be liable to update yourself of such changes, if any, by accessing the changes on the Platform. You shall, at all times, be responsible for regularly reviewing the Terms of Use and the other MadeByMaa policies and note the changes made on the Platform. Your continued usage of the services after any change is posted constitutes your acceptance of the amended Terms of Use and other MadeByMaa policies. As long as you comply with these Terms of Use, MadeByMaa grants you a personal, non-exclusive, non-transferable, limited privilege to access, enter, and use the Platform. By accepting these Terms of Use, you also accept and agree to be bound by the other terms and conditions and MadeByMaa policies as may be posted on the Platform from time to time.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SERVICES PROVIDED BY US:</p>\r\n\r\n<p>MadeByMaa is constantly evolving to provide the best possible experience and information to its users. The primary purpose of services is to connect the Home Chefs to the users. Except for connecting the users to Home Chefs, we are not providing any services, of whatever nature to the users. Users acknowledge that MadeByMaa is not charging any consideration from the users to provide the services. As no consideration is charged from the users, there is no consumer-service provider relationship between users and MadeByMaa. The services are freely offered to the users, and users are free to discontinue receiving services anytime they wish. You acknowledge and agree that the form and nature of the Services that MadeByMaa provides may require effecting certain changes in it, therefore, MadeByMaa reserves the right to suspend/cancel, or discontinue any or all products or services at any time without notice, make modifications and alterations in any or all of its contents, products and services contained on the site without any prior notice.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>TRANSACTION</p>\r\n\r\n<p>All commercial/contractual terms are offered by Home Chefs and agreed to, is between Buyers and Home Chefs alone. The commercial/contractual terms include without limitation price, taxes, shipping costs, payment methods, payment terms, date, period, and mode of delivery, warranties related to products and services, and after-sales services related to products and services. MadeByMaa does not have any control or does not determine or advise or in any way involve itself in the offering or acceptance of such commercial/contractual terms between the Buyers and Merchants. MadeByMaa may, however, offer support services to Home Chefs with respect to order fulfillment, payment collection, call center, and other services, according to independent contracts executed by it with the Home Chefs. The user acknowledges that they are a stranger to this contract and they have nothing to do with this contract. MadeByMaa does not make any representation or warranty as to the item-specifics (such as legal title, creditworthiness, identity, etc.) or specifics such as quality, value, saleability, etc.) of any of the Home Chefs. You are advised to independently verify the bona fides of any particular Home Chefs that you choose to deal with on the Platform and use your best judgment on that behalf. All Home Chefs offers and third-party offers are subject to respective party terms and conditions. MadeByMaa takes no responsibility for such offers.</p>\r\n\r\n<p>MadeByMaa is operating an online marketplace and assumes the role of facilitator, and does not at any point of time during any transaction between Buyer and Home Chefs on the Platform come into or take possession of any of the products or services offered by Home Chefs. At no time shall MadeByMaa hold any right, title, or interest over the products nor shall MadeByMaa have any obligations or liabilities in respect of such contract entered into between Buyer and Home Chefs. MadeByMaa is only providing a platform for communication and it is agreed that the contract for sale/service of any of the products or services shall be a strictly bipartite contract between the Home Chefs and the Buyer.</p>\r\n\r\n<p>MadeByMaa does not endorse any Members, home chefs, Meals, or any Member Content or any sale or service. Also, although these Terms require Home Chefs/Users to provide accurate information, we do not attempt to confirm and do not confirm any Member&#39;s/user&#39;s purported identity. You are responsible for determining the identity and suitability of others whom you contact via the Application and Services. We will not be responsible for any damage or harm resulting from your interactions with other Members/users. By using the Application or Services, you agree that any legal remedy or liability that you seek to obtain for actions or commissions of other Members/users or other third parties will be limited to a claim against the particular Members or other third parties who caused you harm and you agree not to attempt to impose liability on or seek any legal remedy from MadeByMaa concerning such actions or omissions. Accordingly, we encourage you to communicate directly with other members of the Services regarding any Meals or services.</p>\r\n\r\n<p>The Home Chefs are solely responsible for honoring any confirmed bookings and making available any dishes/services reserved through the platform. If you, as a MadeByMaa buyer, choose to enter into a transaction with a Home Chefs for the booking of a Meal, you agree and understand that you will be required to agree with the Home Chefs and you agree to accept any terms, conditions, rules, and restrictions associated with such Meal imposed by the Home Chefs. You acknowledge and agree that you, and not MadeByMaa, will be responsible for performing the obligations of any such agreements, and we are not a party to such agreements and disclaim all liability arising from or related to any such agreements.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>YOUR ACCOUNT:</p>\r\n\r\n<p>You may have to create an account to use some of the features offered by the platform, including without limitation specific pages for Home Chefs on the Platform. Use/storage of any personal information you provide to us during the account creation process is governed by our Privacy Policy. You must keep your password confidential [wherever required] and you are solely responsible for maintaining the confidentiality and security of your account, all changes and updates submitted through your account, and all activities that occur in connection with your account. You are always and solely responsible for all activities that occur in your account. You agree to notify us immediately of any unauthorized use of your account to enable us to take necessary corrective action. You may also be able to register to use the platform by logging into your account with your credentials from certain third-party social networking sites (e.g., Facebook, Gmail, Linkedin, etc). You confirm that you are the owner of any such social media account and that you are entitled to disclose Your social media login information to us. You authorize us to collect your authentication information and other information that may be available on or through your social media account consistent with your applicable settings and instructions. In creating an account, you represent to us that all information provided to us in such a process is true, accurate, and correct and that you will update your information as and when necessary to keep it accurate. You may not impersonate someone else, create or use an account for anyone other than yourself, provide an email address other than your own, create multiple accounts or Home Chef listings except as otherwise authorized by us, or provide or use false information to obtain access to a platform that you are not legally entitled to claim. You acknowledge that any false claim may result in substantial losses or damage to MadeByMaa or third parties, for which you may be held liable and accountable.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ADVERTISING</p>\r\n\r\n<p>Some of the Services are/may be supported by advertising revenue and may display advertisements and promotions. These advertisements may be targeted to the content of information stored on the platform, queries made through the platform, or other information. The manner, mode, and extent of advertising on the platform are subject to change without specific notice to you. You agree that MadeByMaa may place such advertising on the platform.</p>\r\n\r\n<p>Part of the platform may contain advertising information promotional material or other material submitted to MadeByMaa by third parties or Users. Responsibility for ensuring that material submitted for inclusion on the Platform or mobile apps complies with applicable international and national law is exclusively on the party providing the information/material. Your correspondence or business dealings with, or participation in promotions of, advertisers through the Platform, including payment and delivery of related goods or services, and any other terms, conditions, warranties, or representations associated with such dealings, shall be solely between you and such advertiser. MadeByMaa will not be responsible or liable for any error or omission, inaccuracy in advertising material or any loss or damage of any sort incurred as a result of any such dealings or as a result of the presence of such other advertiser(s) on the Platform and mobile application.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>LINKS:</p>\r\n\r\n<p>The Application and Services may contain links to third-party websites or resources. You acknowledge and agree that MadeByMaa is not responsible or liable for: (i) the availability or accuracy of such websites or resources or (ii) the content, products, or services on or available from such websites or resources. Links to such websites or resources do not imply any endorsement by MadeByMaa of such websites or resources or the content, products, or services available from such websites or resources.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>OWNERSHIP:</p>\r\n\r\n<p>You acknowledge and agree that the Application, Services, and Collective Content, including all associated intellectual property rights, are the exclusive property of MadeByMaa and its licensors. You will not remove, alter, or obscure any copyright, trademark, service mark, or other proprietary rights notices incorporated in or accompanying the Application, Services, or Collective Content.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>CONTENT IS PROTECTED:</p>\r\n\r\n<p>All text, photographs, trademarks, logos, sounds, graphics, user interfaces, visual interfaces, music, artwork and computer code (collectively, &ldquo;Content&rdquo;), including but not limited to the design, structure, coordination, selection, expression, &ldquo;look and feel&rdquo; and arrangement of such Content, contained on the platform is owned, controlled or licensed by or to MadeByMaa, and is protected by trade dress, copyright, patent and trademark laws, and various other intellectual property rights laws.</p>\r\n\r\n<p>Except as expressly provided in these Terms of Use, no part of the platform and no Content may be copied, reproduced, republished, publicly displayed, encoded, translated, uploaded, posted, transmitted, or distributed in any way (including &ldquo;mirroring&rdquo;) to any other computer, server, website or another medium for publication or distribution or any commercial enterprise, without our expressed prior consent.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ACCEPTANCE OF TERMS</p>\r\n\r\n<p>On acceptance of the above-said terms, MadeByMaa grants you a personal, limited, non-exclusive, and non-transferable license to access and use the Services only as expressly permitted in these Terms. You shall not use the Services for any illegal purpose or in any manner inconsistent with these Terms. You may use the information made available through the Services solely for your personal, non-commercial use. You agree not to use, copy, display, distribute, modify, broadcast, translate, reproduce, reformat, incorporate into advertisements and other works, sell, promote, create derivative works, or in any way exploit or allow others to exploit any of content in whole or in part except as expressly authorized by us. Except as otherwise expressly granted to you in writing, we do not grant you any other express or implied right or license to the Services, Content, or our IP Rights. Any violation by you of the license provisions contained in this Section may result in the immediate termination of your right to use the Services, as well as potential liability for copyright and other IP Rights infringement depending on the circumstances.</p>\r\n\r\n<p>You acknowledge and agree that if MadeByMaa disables access to your account, you may be prevented from accessing the Services, your account details, or any files or other content, which is contained in your account. We may, at our discretion and without liability to you, with or without cause, with or without prior notice, and at any time: (a) terminate or suspend these Terms or your access to our Application and Services.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>PRIVACY POLICY</p>\r\n\r\n<p>You represent that you have read understood and agreed to our Privacy Policy. Please note that we may disclose information about you to third parties or government authorities if we believe that such disclosure is reasonably necessary to (i) take action regarding suspected illegal activities; (ii) enforce or apply our Terms and Privacy Policy; (iii) comply with legal process or other government inquiry, such as a search warrant, subpoena, statute, judicial proceeding, or other legal processes/notice served on us; or (iv) protect our rights, reputation, and property, or that of our users, affiliates, or the general public.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>GENERAL TERMS</p>\r\n\r\n<p>Interpretation: The section and subject headings in these Terms are included for reference only and shall not be used to interpret any provisions of these Terms.</p>\r\n\r\n<p>Entire Agreement and Waiver: The Terms, together with the &#39;Privacy Policy and &#39;Guidelines and Policies, shall constitute the entire agreement between you and us concerning the Services. No failure or delay by us in exercising any right, power, or privilege under the Terms shall operate as a waiver of such right or acceptance of any variation of the Terms, and nor shall any single or partial exercise by either party of any right, power or privilege preclude any further exercise of that right or the exercise of any other right, power or privilege.</p>\r\n\r\n<p>Severability: If any provision of these Terms is deemed unlawful, invalid, or unenforceable by a judicial court for any reason, then that provision shall be deemed severed from these Terms, and the remainder of the Terms shall continue in full force and effect.</p>\r\n\r\n<p>Partnership or Agency: Acceptance of these terms and conditions merely amounts to acceptance for use of the platform. None of the provisions of these Terms shall be deemed to constitute a partnership or agency or consumer or any specific legal relationship between you and MadeByMaa and you shall have no authority to bind MadeByMaa in any form or manner, whatsoever.</p>\r\n\r\n<p>Governing Law: These Terms of Use are governed by the laws of India. Any action, suit, or other legal proceedings, which is commenced to resolve any matter arising under or relating to this Platform, shall be subject to the jurisdiction of the courts at the National Capital Territory of Delhi, India. You agree that all matters relating to your access to or use of the platform, including all disputes, will be governed by the laws as applicable in the National Capital Territory of Delhi, India. You further agree that only courts of jurisdiction in the National Capital Territory of Delhi, India shall have exclusive right to entertain any dispute/claim arising out of terms of use of this website. Further, you unconditionally submit to the jurisdiction of such courts in the National Capital Territory of Delhi, India.</p>\r\n\r\n<p>Indemnity You agree to indemnify and hold MadeByMaa, its officers, directors, shareholders, predecessors, successors in interest, employees, agents, subsidiaries, and affiliates, harmless from any demands, loss, liability, claims, or expenses (including attorneys&rsquo; fees), made against MadeByMaa any third party due to or arising out of or in connection with your use of the Platform.</p>\r\n\r\n<p>Disclaimer: We do not promise that the platform of any of its content or service of the feature will be error-free or uninterrupted. We do not promise that the use of this site shall result in any benefit to you or you will achieve specific results. The website is delivered on an as-is and as-available basis. All information provided on the website is subject to change without any notice. We don&rsquo;t promise that any data downloaded from the site shall be free of viruses contamination or destructive features. We deny any warranty of accuracy, non-infringement, fitness, or usefulness of any feature of this website or content available therein.</p>\r\n\r\n<p>Limitation of Relief: Your sole remedy/relief against the website or any of its content features or services is to stop using the platform or its content. This limitation of relief is part of the terms of use of this website/app.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1>SELLER TERMs &amp; CONDITIONS</h1>\r\n\r\n<p>This document is an electronic record in terms of the Information Technology Act, 2000 and rules made thereof electronic records. This document is published by the provisions of Rule 3 (1) of the Information Technology (Intermediaries guidelines) Rules, 2011 that require publishing the rules and regulations, privacy policy, and Terms of Use for access or usage http://www.madebymaa.in and MadeByMaa application for mobile and handheld devices. The Website and the Application for handheld devices are jointly referred to as the &ldquo;Platform&rdquo;.</p>\r\n\r\n<p>DEFINITIONS :</p>\r\n\r\n<p>User: &quot;User&quot; or &quot;You&quot; or &quot;Your&quot; refers to you, as a user of the Services. A user is someone who accesses or uses the Services to host, publish, transact, share, display, or upload information or views or pictures and includes other persons jointly participating in using the Services, including, without limitation, a user having access to &ldquo;Home Chef business page&#39; to manage claimed Home Chef listings or otherwise.</p>\r\n\r\n<p>Content: &quot;Content&quot; will include (but is not limited to) reviews, images, photos, audio, video, location data, nearby places, and all other forms of information or data.</p>\r\n\r\n<p>&quot;Your Content&quot; or &quot;User Content&quot; means content that you upload, share, or transmit to, through or in connection with the Services, such as likes, ratings, reviews, images, photos, messages, profile information, and any other materials that you publicly display or displayed in your account profile.</p>\r\n\r\n<p>&quot;Third Party Content&quot; means content that comes from parties other than MadeByMaa or its users and is available on the Services.</p>\r\n\r\n<p>&quot;MadeBymaa Content&quot; means content that &ldquo;MadeByMaa&rdquo; creates and makes available in connection with the Services including, but not limited to, graphics, design, compilation, computer code, products, software, visual interfaces, interactive features, aggregate ratings, reports, and other usage-related data in connection with activities associated with your account and all other elements and components of the Services excluding Your Content and Third Party Content.</p>\r\n\r\n<p>TERMS:</p>\r\n\r\n<p>MadeByMaa Food Network Private Limited (hereinafter referred to as &quot;MadeBymaa &quot;, &ldquo;company&rdquo;, &quot;we&quot;, &quot;us&quot;, or &quot;our&quot;) provides an online marketplace/App for handheld devices that connects Home-chefs who want to provide Food Services to users looking for home-cooked meals (collectively, the &quot;Services&quot;). By using the Application and the Services, you agree to comply with and be legally bound by the terms and conditions of these Terms of Service (&quot;Terms&quot;), whether or not you become a registered user of the Services. These Terms govern your access to and use of the Application, Services, and all content, and your participation in referral and other promotion programs undertaken by us from time to time (&quot;Referral Programs&quot;), and these terms of use constitute a binding legal agreement between you and MadeByMaa. Please read carefully these Terms and our Privacy Policy, which may be found here, and which is incorporated by reference into these Terms.</p>\r\n\r\n<p>If you do not agree to these Terms, you have no right to obtain information from and/or otherwise use the Application or Services.</p>\r\n\r\n<p>These Terms of Service (the &quot;Terms&quot;) are intended to make you aware of your legal rights and responsibilities concerning your access to and use of the website at [web address] (the &quot;Site&quot;) and any related mobile or software applications including but not limited to delivery of information via the website whether existing now or in the future that links to the Terms (collectively, the &quot;Services&quot;). These Terms are effective for all existing and future users, including but without limited to users having access to the restaurant business page&#39; to manage their claimed business listings.</p>\r\n\r\n<p>Please read these Terms of Use carefully before you use the services. If you do not agree to these Terms of Use, you may not use the services on the Platform, and we request you to uninstall the App. By installing, downloading, or even merely using the Platform, you shall be contracting with MadeByMaa and signify your acceptance to the Terms of Use and other policies (including but not limited to the Cancellation &amp; Refund Policy, Privacy Policy, and Take Down Policy) as posted on the Platform from time to time, which takes effect on the date on which you download, install or use the Services, and create a legally binding arrangement to abide by the same. You may not use the Services if you do not accept the Terms or are unable to be bound by the Terms. Your use of the Platform is at your own risk, including the risk of data theft, virus attack, or that you might be exposed to content that is objectionable, or otherwise inappropriate.</p>\r\n\r\n<p>The Content on these Services is for informational purposes only. MadeByMaa disclaims any liability for any information that may have become outdated since the last time the particular piece of information was updated. MadeByMaa reserves the right to make changes and corrections to any part of the Content on these Services at any time without prior notice. MadeByMaa does not guarantee the quality of the Goods, the prices listed in menus, or the availability of all menu items at any of the listings of Home Chefs.</p>\r\n\r\n<p>ELIGIBILITY TO USE THE SERVICES:</p>\r\n\r\n<p>You hereby represent and warrant that you are at least eighteen (18) years of age or above and are fully able and competent to understand and agree to the terms, conditions, obligations, affirmations, representations, and warranties outlined in these Terms. You further declare that you comply with all laws and regulations in the locality/state/country in which you live when you access and use the Services. You agree to use the Services only in compliance with these Terms and applicable law, and in a manner that does not violate our legal rights or those of any third party(ies).</p>\r\n\r\n<p>We may vary amend change or update these Terms, from time to time entirely at its discretion. Your use of Platform after any such amendment or change in the Terms shall be deemed as your express acceptance to such amended/changed terms and you also agree to be bound by such changed/amended Terms. You shall be responsible for checking these Terms from time to time and ensuring continued compliance with these Terms.</p>\r\n\r\n<p>These Terms of Use are subject to modifications at any time. We reserve the right to modify or change these Terms of Use and other MadeByMaa policies at any time by posting changes on the Platform, and you shall be liable to update yourself of such changes, if any, by accessing the changes on the Platform. You shall, at all times, be responsible for regularly reviewing the Terms of Use and the other MadeByMaa policies and note the changes made on the Platform. Your continued usage of the services after any change is posted constitutes your acceptance of the amended Terms of Use and other MadeByMaa policies. As long as you comply with these Terms of Use, MadeByMaa grants you a personal, non-exclusive, non-transferable, limited privilege to access, enter, and use the Platform. By accepting these Terms of Use, you also accept and agree to be bound by the other terms and conditions and MadeByMaa policies as may be posted on the Platform from time to time.</p>\r\n\r\n<p>SERVICES PROVIDED BY US:</p>\r\n\r\n<p>MadeByMaa is constantly evolving to provide the best possible experience and information to its users. The primary purpose of services is to connect the Home Chefs to the users. Except for connecting the users to Home Chefs, we are not providing any services, of whatever nature to the users. Users acknowledge that MadeByMaa is not charging any consideration from the users to provide the services. As no consideration is charged from the users, there is no consumer-service provider relationship between users and MadeByMaa. The services are freely offered to the users, and users are free to discontinue receiving services anytime they wish.</p>\r\n\r\n<p>You acknowledge and agree that the form and nature of the Services that MadeByMaa provides may require effecting certain changes in it, therefore, MadeByMaa reserves the right to suspend/cancel, or discontinue any or all products or services at any time without notice, make modifications and alterations in any or all of its contents, products and services contained on the site without any prior notice.</p>\r\n\r\n<p>TRANSACTION</p>\r\n\r\n<p>All commercial/contractual terms are offered by Home Chefs and agreed to, is between Buyers and Home Chefs alone. The commercial/contractual terms include without limitation price, taxes, shipping costs, payment methods, payment terms, date, period, and mode of delivery, warranties related to products and services, and after-sales services related to products and services. MadeByMaa does not have any control or not determine advise or in any way involve itself in the offering or acceptance of such commercial/contractual terms between the Buyers and Merchants.</p>\r\n\r\n<p>MadeByMaa may, however, offer support services to Home Chefs concerning order fulfillment, payment collection, call center, and other services, according to independent contracts executed by it with the Home Chefs. The user acknowledges that they are a stranger to this contract and they have nothing to do with this contract.</p>\r\n\r\n<p>MadeByMaa does not make any representation or warranty as to the item-specifics (such as legal title, creditworthiness, identity, etc.) or specifics such as quality, value, saleability, etc.) of any of the Home Chefs. You are advised to independently verify the bona fides of any particular Home Chefs that you choose to deal with on the Platform and use your best judgment on that behalf. All Home Chefs offers and third-party offers are subject to respective party terms and conditions. MadeByMaa takes no responsibility for such offers.</p>\r\n\r\n<p>MadeByMaa is operating an online marketplace and assumes the role of facilitator, and does not at any point of time during any transaction between Buyer and Home Chefs on the Platform come into or take possession of any of the products or services offered by Home Chefs. At no time shall MadeByMaa hold any right, title, or interest over the products nor shall MadeByMaa have any obligations or liabilities in respect of such contract entered into between Buyer and Home Chefs. MadeByMaa is only providing a platform for communication and it is agreed that the contract for the sale/service of any of the products or services shall be a strictly bipartite contract between the Home Chefs and the Buyer.</p>\r\n\r\n<p>MadeByMaa does not endorse any Members, home chefs, Meals, or any Member Content or any sale or service. Also, although these Terms require Home Chefs/Users to provide accurate information, we do not attempt to confirm and do not confirm any Member&#39;s/user&#39;s purported identity. You are responsible for determining the identity and suitability of others whom you contact via the Application and Services. We will not be responsible for any damage or harm resulting from your interactions with other Members/users. By using the Application or Services, you agree that any legal remedy or liability that you seek to obtain for actions or omissions of other Members/users or other third parties will be limited to a claim against the particular Members or other third parties who caused you harm and you agree not to attempt to impose liability on or seek any legal remedy from MadeByMaa concerning such actions or omissions. Accordingly, we encourage you to communicate directly with other members of the Services regarding any Meals or services.</p>\r\n\r\n<p>The Home Chefs are solely responsible for honoring any confirmed bookings and making available any dishes/services reserved through the platform. If you, as a MadeByMaa buyer, choose to enter into a transaction with a Home Chefs for the booking of a Meal, you agree and understand that you will be required to agree with the Home Chefs and you agree to accept any terms, conditions, rules, and restrictions associated with such Meal imposed by the Home Chefs. You acknowledge and agree that you, and not MadeByMaa, will be responsible for performing the obligations of any such agreements, and we are not a party to such agreements and disclaim all liability arising from or related to any such agreements.</p>\r\n\r\n<p>YOUR ACCOUNT:</p>\r\n\r\n<p>You may have to create an account to use some of the features offered by the platform, including without limitation specific pages for Home Chefs on the Platform. Use/storage of any personal information you provide to us during the account creation process is governed by our Privacy Policy. You must keep your password confidential [wherever required] and you are solely responsible for maintaining the confidentiality and security of your account, all changes and updates submitted through your account, and all activities that occur in connection with your account. You are always and solely responsible for all activities that occur in your account. You agree to notify us immediately of any unauthorized use of your account to enable us to take necessary corrective action.</p>\r\n\r\n<p>You may also be able to register to use the platform by logging into your account with your credentials from certain third-party social networking sites (e.g., Facebook, Gmail, LinkedIn, etc). You confirm that you are the owner of any such social media account and that you are entitled to disclose Your social media login information to us. You authorize us to collect your authentication information and other information that may be available on or through your social media account consistent with your applicable settings and instructions.</p>\r\n\r\n<p>In creating an account, you represent to us that all information provided to us in such a process is true, accurate, and correct and that you will update your information as and when necessary to keep it accurate. You may not impersonate someone else, create or use an account for anyone other than yourself, provide an email address other than your own, create multiple accounts or Home Chef listings except as otherwise authorized by us or provide or use false information to obtain access to the platform that you are not legally entitled to claim. You acknowledge that any false claim may result in substantial losses or damage to MadeByMaa or third parties, for which you may be held liable and accountable.</p>\r\n\r\n<p>ADVERTISING</p>\r\n\r\n<p>Some of the Services are/may be supported by advertising revenue and may display advertisements and promotions. These advertisements may be targeted to the content of information stored on the platform, queries made through the platform, or other information. The manner, mode, and extent of advertising on the platform are subject to change without specific notice to you. You agree that MadeByMaa may place such advertising on the platform.</p>\r\n\r\n<p>Part of the platform may contain advertising information promotional material or other material submitted to MadeByMaa by third parties or Users. Responsibility for ensuring that material submitted for inclusion on the Platform or mobile apps complies with applicable international and national law is exclusively on the party providing the information/material. Your correspondence or business dealings with, or participation in promotions of, advertisers through the Platform, including payment and delivery of related goods or services, and any other terms, conditions, warranties, or representations associated with such dealings, shall be solely between you and such advertiser. MadeByMaa will not be responsible or liable for any error or omission, inaccuracy in advertising material or any loss or damage of any sort incurred as a result of any such dealings or as a result of the presence of such other advertiser(s) on the Platform and mobile application.</p>\r\n\r\n<p>LINKS:</p>\r\n\r\n<p>The Application and Services may contain links to third-party websites or resources. You acknowledge and agree that MadeByMaa is not responsible or liable for: (i) the availability or accuracy of such websites or resources or (ii) the content, products, or services on or available from such websites or resources. Links to such websites or resources do not imply any endorsement by MadeByMaa of such websites or resources or the content, products, or services available from such websites or resources.</p>\r\n\r\n<p>OWNERSHIP:</p>\r\n\r\n<p>You acknowledge and agree that the Application, Services, and Collective Content, including all associated intellectual property rights, are the exclusive property of MadeByMaa and its licensors. You will not remove, alter, or obscure any copyright, trademark, service mark, or other proprietary rights notices incorporated in or accompanying the Application, Services, or Collective Content.</p>\r\n\r\n<p>CONTENT IS PROTECTED:</p>\r\n\r\n<p>All text, photographs, trademarks, logos, sounds, graphics, user interfaces, visual interfaces, music, artwork and computer code (collectively, &ldquo;Content&rdquo;), including but not limited to the design, structure, coordination, selection, expression, &ldquo;look and feel&rdquo; and arrangement of such Content, contained on the platform is owned, controlled or licensed by or to MadeByMaa, and is protected by trade dress, copyright, patent and trademark laws, and various other intellectual property rights laws.</p>\r\n\r\n<p>Except as expressly provided in these Terms of Use, no part of the platform and no Content may be copied, reproduced, republished, publicly displayed, encoded, translated, uploaded, posted, transmitted, or distributed in any way (including &ldquo;mirroring&rdquo;) to any other computer, server, website or another medium for publication or distribution or any commercial enterprise, without our expressed prior consent.</p>\r\n\r\n<p>USER CONTENT:</p>\r\n\r\n<p>The user/chef understands and consents to the use of his/her likeness, pictures, videos, and clinical details related to his product/her person in photographs and videos for MadeByMaa Food Network Private Limited. on their website or app, as well as in publicity concerning the same.</p>\r\n\r\n<p>That the company shall have the sub-licensable and worldwide right to use any details, photographs, videos, etc. in any legally permissible manner whatsoever. The use may include but is not limited to, editing, duplication, licensing, distribution, and incorporation in other works, in whatever form (e.g. hard copy or electronic), such as posters, publications, websites, films, or videos, and their unrestricted use, without any obligation on the part of MadeByMaa Food Network Private Limited to seek any further authorization by the undersigned.</p>\r\n\r\n<p>The user/chef understands and agrees that he/she will not be entitled to receive any consideration or payment royalty or credit for the use of photograph/video/details etc. related to their product or person etc. according to this agreement.</p>\r\n\r\n<p>Any photographs or product person, video, or other details shared on the App or website or created by the company shall be the exclusive property of the company, and the company may use it in any legally permissible manner, including but not limited to advertising, promotion, etc. The rights/permissions granted through this agreement are irrevocable.</p>\r\n\r\n<p>ACCEPTANCE OF TERMS</p>\r\n\r\n<p>On acceptance of the above-said terms, MadeByMaa grants you a personal, limited, non-exclusive, and non-transferable license to access and use the Services only as expressly permitted in these Terms. You shall not use the Services for any illegal purpose or in any manner inconsistent with these Terms. You may use the information made available through the Services solely for your personal, non-commercial use. You agree not to use, copy, display, distribute, modify, broadcast, translate, reproduce, reformat, incorporate into advertisements and other works, sell, promote, create derivative works, or in any way exploit or allow others to exploit any of content in whole or in part except as expressly authorized by us. Except as otherwise expressly granted to you in writing, we do not grant you any other express or implied right or license to the Services, Content, or our IP Rights. Any violation by you of the license provisions contained in this Section may result in the immediate termination of your right to use the Services, as well as potential liability for copyright and other IP Rights infringement depending on the circumstances.</p>\r\n\r\n<p>You acknowledge and agree that if MadeByMaa disables access to your account, you may be prevented from accessing the Services, your account details, or any files or other content, which is contained in your account.</p>\r\n\r\n<p>We may, at our discretion and without liability to you, with or without cause, with or without prior notice, and at any time: (a) terminate or suspend these Terms or your access to our Application and Services.</p>\r\n\r\n<p>PRIVACY POLICY</p>\r\n\r\n<p>You represent that you have read understood and agreed to our Privacy Policy. Please note that we may disclose information about you to third parties or government authorities if we believe that such disclosure is reasonably necessary to (i) take action regarding suspected illegal activities; (ii) enforce or apply our Terms and Privacy Policy; (iii) comply with legal process or other government inquiry, such as a search warrant, subpoena, statute, judicial proceeding, or other legal processes/notice served on us; or (iv) protect our rights, reputation, and property, or that of our users, affiliates, or the general public.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>WE CARE ABOUT YOUR PRIVACY:</p>\r\n\r\n<p>We, at MadeByMaa Food Network Private Limited, are committed to respecting your privacy and complying with applicable data protection and privacy regulations as applicable in India. This privacy policy (&ldquo;Policy&rdquo;) describes how we collect and use personal information. &ldquo;Personal information&rdquo; means information relating to you or another identifiable individual who has signed up on the Application to secure our services.</p>\r\n\r\n<p>WE DO NOT COLLECT PERSONAL INFORMATION:</p>\r\n\r\n<p>As a general rule, this website does not collect personal information about you when you visit the website, browse on the site or see the information available on the site. You can generally visit the site without revealing personal information unless you choose to provide such information through the &ldquo;Sign Up&rdquo; process.</p>\r\n\r\n<p>When you access our services online, our web servers automatically create records of your visit. These records typically include IP address, access times, the sites linked from, pages visited, the links and features used, the content viewed or requested browser or application type, language, and other such information. We will not identify users or their browsing activities, except when a law enforcement agency may exercise a warrant to inspect the service provider&#39;s logs. The application will collect personal data to provide you with the best services and support. The personal information may include but is not limited to, your Name, Address(es), Phone Number, E-mail address, and Gender that could help the application identify you.</p>\r\n\r\n<p>WHAT INFORMATION IS COLLECTED:</p>\r\n\r\n<p>Most of the personal information is collected from you when you sign up for an account on the application to avail of the services offered by MadeByMaa. Some more data can be collected when you contact customer service through calls or e-mail. Information may also be collected in case of adding any favorites saving any preferences on the application or subscribing to the mailing list.</p>\r\n\r\n<p>To DELIVER THE BEST SERVICES TO YOU, WE MAY COLLECT THE FOLLOWING INFORMATION:</p>\r\n\r\n<p>Account-related information is collected when you sign up for our Services. Your data may include information such as Name, Address(es), Phone Number, Email Address, E-mail address, and Gender, or other data that could directly or indirectly identify you.</p>\r\n\r\n<p>Service Usage Data is automatically collected when you interact with our website. This information may include data about your interactions with website features, content and links contained in our Services, time of interaction, browser type and configuration, operating system used, IP address, language preferences, and other cookie data. While none of this data will allow us to directly identify who you are, some of this data can be used to approximate your location. For additional information on how to manage the technologies we use, please visit our &ldquo;cookie policy&rdquo;.</p>\r\n\r\n<p>Supplementary Data may be received about you from third-party sources, such as public databases, or if you sign-up or log in through third-party service providers like Facebook Twitter, or email. We may combine this data with the information we already have about you to maintain the accuracy of our records and provide services/information that you may be interested in.</p>\r\n\r\n<p>HOW THE INFORMATION IS USED:</p>\r\n\r\n<p>We strive to collect the information that is of utmost importance to ensure that the user has a good experience of using the application while all other regulations are complied with. We only collect relevant information after securing the requisite permission from the user when it is needed to deliver the services you have requested, for legal compliance, or for any other lawful purpose.</p>\r\n\r\n<p>AGENTS:</p>\r\n\r\n<p>We employ other companies and people to perform tasks on our behalf and need to share your information with them to provide products or services to you. Unless we tell you differently, our agents do not have any right to use the Personal Information we share with them beyond what is necessary to assist us.</p>\r\n\r\n<p>USER PROFILES AND SUBMISSIONS:</p>\r\n\r\n<p>Certain user profile information, including without limitation a user&#39;s name and location may be displayed to other users to facilitate user interaction within the Application and Services or address your request for the Company&#39;s services. Your account privacy settings allow you to limit the other users who can see the Personal Information in your user profile and/or what information in your user profile is visible to others. However, we do not control the policies and practices of any other third-party site or service that may interact with our Applications and Services.</p>\r\n\r\n<p>TRANSFERS:</p>\r\n\r\n<p>We may choose to buy or sell assets. In these types of transactions, customer information is typically one of the business assets that would be transferred. Also, if we (or our assets) are acquired, or if we go out of business, enter bankruptcy, or go through some other change of control, Personal Information would be one of the assets transferred to or acquired by a third party.</p>\r\n\r\n<p>CHANGES TO OUR PRIVACY POLICY:</p>\r\n\r\n<p>We reserve the right to modify/amend this Privacy Policy at any time. Please review this document whenever you visit our website, so that you are aware of what information we collect and how we use it.</p>\r\n\r\n<p>DATA PROTECTION CONCERN:</p>\r\n\r\n<p>We maintain your data subject to the Data Protection Regulation applicable in India. If you have any questions or concerns regarding our Privacy Policy, you may contact us by Email: at help@madebymaa.in and We will respond to all requests within 30 days.</p>\r\n\r\n<p>ACCEPTANCE OF THE POLICY:</p>\r\n\r\n<p>By visiting our website, signing up or logging into the website, and uploading information on our website; you acknowledge and unconditionally accept the policy. If you do not agree with this Policy, do not use our website and services or provide any of your data.</p>\r\n\r\n<p>GENERAL TERMS</p>\r\n\r\n<p>Interpretation: The section and subject headings in these Terms are included for reference only and shall not be used to interpret any provisions of these Terms.</p>\r\n\r\n<p>Entire Agreement and Waiver: The Terms, together with the &#39;Privacy Policy and &#39;Guidelines and Policies, shall constitute the entire agreement between you and us concerning the Services. No failure or delay by us in exercising any right, power, or privilege under the Terms shall operate as a waiver of such right or acceptance of any variation of the Terms, and nor shall any single or partial exercise by either party of any right, power or privilege preclude any further exercise of that right or the exercise of any other right, power or privilege.</p>\r\n\r\n<p>Severability: If any provision of these Terms is deemed unlawful, invalid, or unenforceable by a judicial court for any reason, then that provision shall be deemed severed from these Terms, and the remainder of the Terms shall continue in full force and effect.</p>\r\n\r\n<p>Partnership or Agency: Acceptance of these terms and conditions merely amounts to acceptance for use of the platform. None of the provisions of these Terms shall be deemed to constitute a partnership or agency or consumer or any specific legal relationship between you and MadeByMaa and you shall have no authority to bind MadeByMaa in any form or manner, whatsoever.</p>\r\n\r\n<p>Governing Law: These Terms of Use are governed by the laws of India. Any action, suit, or other legal proceedings, which is commenced to resolve any matter arising under or relating to this Platform, shall be subject to the jurisdiction of the courts at the National Capital Territory of Delhi, India. You agree that all matters relating to your access to or use of the platform, including all disputes, will be governed by the laws as applicable in the National Capital Territory of Delhi, India. You further agree that only courts of jurisdiction in the National Capital Territory of Delhi, India shall have exclusive right to entertain any dispute/claim arising out of terms of use of this website. Further, you unconditionally submit to the jurisdiction of such courts in the National Capital Territory of Delhi, India.</p>\r\n\r\n<p>Indemnity You agree to indemnify and hold MadeByMaa, its officers, directors, shareholders, predecessors, successors in interest, employees, agents, subsidiaries, and affiliates, harmless from any demands, loss, liability, claims, or expenses (including attorneys&rsquo; fees), made against MadeByMaa any third party due to or arising out of or in connection with your use of the Platform.</p>\r\n\r\n<p>Disclaimer: We do not promise that the platform of any of its content or service of the feature will be error-free or uninterrupted. We do not promise that the use of this site shall result in any benefit to you or you will achieve specific results. The website is delivered on an as-is and as-available basis. All information provided on the website is subject to change without any notice. We don&rsquo;t promise that any data downloaded from the site shall be free of viruses contamination or destructive features. We deny any warranty of accuracy, non-infringement, fitness, or usefulness of any feature of this website or content available therein.</p>\r\n\r\n<p>&nbsp;Limitation of Relief: Your sole remedy/relief against the website or any of its content features or services is to stop using the platform or its content. This limitation of relief is part of the terms of use of this website.</p>\r\n\r\n<p>Contact Us: Please contact us for any questions comments or inquiries regarding this Platform on feedback@...</p>\r\n\r\n<p>GRIEVANCE OFFICER</p>\r\n\r\n<p>Under the Information Technology Act, 2000 and the rules made thereunder, the name and contact details of the Grievance Officer are provided below:</p>\r\n\r\n<p>Phone: +91 9297661293</p>\r\n\r\n<p>Email: help@madebymaa.in</p>\r\n\r\n<p>Time: Mon-Sat (9:00 - 18:00)</p>', NULL, NULL);
